                    <tr>
                        <td style="width: 48.51em; padding-left: 0.31em; padding-right: 0.31em; border-width: 1px; border-style: solid; border-color: black;" colspan="12" valign="top">
                            <p id="P00250077" class="formattext" align="justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Примечания <br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1 В латуни марки Л68, предназначенной для изготовления изделий специального назначения, массовая доля элементов не должна быть более: железа - 0,07%, сурьмы - 0,002%, фосфора - 0,005%, мышьяка - 0,005%, серы - 0,002% (сумма прочих элементов - 0,2%). <br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2 В латунях марок Л96, Л90, Л80, Л70, Л68, Л63, Л60 допускается массовая доля никеля до 0,3% за счет массовой доли меди, которую не учитывают в сумме прочих элементов. <br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;3 В латунях всех марок по согласованию с потребителем можно определять массовую долю олова, алюминия, марганца и кремния, значения которых учитывают в сумме прочих элементов. <br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;4 В латуни марки Л70, применяемой для производства конденсаторных труб и теплообменников, допускается массовая доля мышьяка до 0,06% за счет массовой доли меди, которую не учитывают в сумме прочих элементов. <br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;5 В латуни марки Л63, применяемой в пищевой промышленности, массовая доля свинца не должна быть более 0,05%. <br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;6 Для антимагнитных сплавов массовая доля железа не должна быть более 0,03%. <br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;7 Расчетная плотность указана для расчета справочной теоретической массы изделий. <br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;8 Знак "-", проставленный одновременно для верхнего и нижнего пределов массовой доли элемента, обозначает, что данный элемент не нормируется и определяется только по указанному в заказе требованию потребителя, и в этом случае содержание данного элемента включается в сумму прочих элементов.<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;9 Примеси, не указанные в таблице, учитывают в сумме прочих элементов, перечень которых определяют согласованием между потребителем и изготовителем.<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Примесью следует считать элемент, у которого указан только максимальный предел его содержания.</p>
