                            <p id="P002700AE" class="formattext" align="justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Примечания<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1 В свинцовых латунях допускается массовая доля никеля не более 0,5%, в латунях марок ЛС59-1, ЛС59-1В, ЛС58-2 и ЛС58-3 - не более 1% за счет массовой доли меди, которую не учитывают в общей сумме прочих элементов.<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2 В латуни марки ЛС59-1 сумма элементов олова и кремния должна быть не более 0,5%. <br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;3 В латунях всех марок можно определять массовую долю олова, алюминия, марганца и кремния. <br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;4 В латуни марки ЛС58-2 массовая доля сурьмы при изготовлении прутков допускается не более 0,1%. <br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;5 Расчетная плотность указана для расчета справочной теоретической массы изделий. <br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;6 Знак "-", проставленный одновременно для верхнего и нижнего пределов массовой доли элемента, обозначает, что данный элемент не нормируется и определяется только по указанному в заказе требованию потребителя, и в этом случае содержание данного элемента включается в сумму прочих элементов.<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;7 Примеси, не указанные в таблице, учитывают в сумме прочих элементов, перечень которых определяют согласованием между потребителем и изготовителем.<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Примесью следует считать элемент, у которого указан только максимальный предел его содержания.</p>
