                        <td style="width: 70.07em; padding-left: 0.31em; padding-right: 0.31em; border-width: 1px; border-style: solid; border-color: black;" colspan="19" valign="top">
                            <p id="P002901D5" class="formattext" align="justify">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Примечания<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;1 В сложнолегированных латунях, кроме марок ЛАН59-3-2, Л75мк, ЛА77-2у, допускается массовая доля никеля до 0,5%, которая не входит в общую сумму прочих элементов, а засчитывается в счет массовой доли меди.<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2 В латуни марки ЛМц58-2 по требованию потребителя массовую долю марганца устанавливают в пределах 3,0%-4,0%. <br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;3 В латуни ЛКБО62-0,2-0,04-0,5 массовая доля содержания бора должна быть в пределах от 0,03% до 0,10%, которую не включают в сумму прочих элементов.<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;4 В латуни марки ЛА77-2у массовая доля железа менее 0,03% не является браковочным признаком. <br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;5 В латуни марки ЛАМш77-2-0,04 суммарная массовая доля фосфора и мышьяка не должна быть более 0,04%. <br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;6 Изготовление латуни марки ЛОМш70-1-0,04 допускается без массовой доли мышьяка.<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;7 Расчетная плотность указана для расчета справочной теоретической массы изделий. <br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;8 Знак "-", проставленный одновременно для верхнего и нижнего пределов массовой доли элемента, обозначает, что данный элемент не нормируется и определяется только по указанному в заказе требованию потребителя, и в этом случае содержание данного элемента включается в сумму прочих элементов.<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;9 Примеси, не указанные в таблице, учитывают в общей сумме прочих элементов, перечень которых определяют согласованием между потребителем и изготовителем.<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Примесью следует считать элемент, у которого указан только максимальный предел его содержания.</p>
